import React from 'react';
import PropTypes from 'prop-types';
import Panel from '@vkontakte/vkui/dist/components/Panel/Panel';
import PanelHeader from '@vkontakte/vkui/dist/components/PanelHeader/PanelHeader';
import Button from '@vkontakte/vkui/dist/components/Button/Button';
import Group from '@vkontakte/vkui/dist/components/Group/Group';
import Cell from '@vkontakte/vkui/dist/components/Cell/Cell';
import Div from '@vkontakte/vkui/dist/components/Div/Div';
import Avatar from '@vkontakte/vkui/dist/components/Avatar/Avatar';
import {Card, CardGrid} from '@vkontakte/vkui'

class Home extends React.Component {
	constructor(props) {
		 super();
		 this.props = props;
	}

	render() {
		const VK_INIT = 'VK.init({apiId: 7472129});'
		const VK_AUTH = 'VK.Widgets.Auth("vk_auth", {"authUrl":"/app"});';
		return <Panel id={this.props.id}>
						<PanelHeader left={<Avatar src="../img/communicabio.svg"/>}>Communicabio</PanelHeader>

						<CardGrid>
							<Card size="l">
								2 предложения о Communicabio
							</Card>

							<Card size="l">
								Вкусное длинное описание
							</Card>
						</CardGrid>

						<script type="text/javascript" src="https://vk.com/js/api/openapi.js?168"></script>
						<script type="text/javascript">{VK_INIT}</script>

						<div id="vk_auth"></div>
						<script type="text/javascript">{VK_AUTH}</script>
					</Panel>
	}
}

export default Home;
